  {nameDir: 'папка1.1',   id: 2,childe: [6]},
  {nameDir: 'папка2.1',   id: 4,childe: []},
  {nameDir: 'папка2.2',   id: 3,childe: []}
];

const App = () =>{
console.log (listDir);
let newList =  listDir.map( name  => <li>{name.nameDir}</li>);
  return (
    <div className="App">
      <ul><p>список</p>
      <li  key={Math.random()}>{newList}</li>
      </ul>
    </div>
  );
}


export default App;
